CREATE TABLE categories(
   num_thesaurus         BIT  NOT "" PRIMARY KEY
  ,num_noeud             INTEGER  NOT ""
  ,langue                VARCHAR(5) NOT ""
  ,libelle_categorie     VARCHAR(47) NOT ""
  ,note_application      VARCHAR(30)
  ,comment_public        VARCHAR(30)
  ,comment_voir          VARCHAR(30)
  ,index_categorie       VARCHAR(47) NOT ""
  ,path_word_categ       VARCHAR(30)
  ,index_path_word_categ VARCHAR(30)
);
